import React from "react";
import Header from "../layouts/Header";

const HomePage = () => {
    return (
        <>
            <Header/>
            <main className="p-8">
                <h1 className="text-3xl text-white mt-4">Test</h1>
                <div className="w-48">
                    <img src="https://fdn2.gsmarena.com/vv/pics/apple/apple-iphone-15-pro-1.jpg" alt="Iphone 15 Pro" />
                </div>
            </main>
        </>
    )
}

export default HomePage;
